import React from "react";

class Friends extends React.Component {
  state = { title: [""], summary: [""], photoImage: [""] };
  componentDidMount() {}

  mapFriend = (oneFriend) => {
    return (
      <div className="card col-md-3">
        <img src={oneFriend.photoImage} className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title">{oneFriend.title}</h5>
          <p className="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
          <button className="btn btn-primary link-button">Go somewhere</button>
        </div>
      </div>
    );
  };
  mapFriendSimple = (oneFriend) => {
    return <p key={`,myFriends-${oneFriend.id}`}>{oneFriend.title}</p>;
  };
  render() {
    return (
      <div className="col-md-12 p-5">
        <h1>Friends</h1>
        <hr />
        <div className="row">{this.state.Friends.map(this.mapFriend)}</div>
      </div>
    );
  }
}
export default Friends;
